import React from 'react';
import './AboutMe2.css';

function AboutMe2() {
  const isMobile = /Mobi/.test(navigator.userAgent);

  if(isMobile){
    return (
      <div>
        none
      </div>
    );
  }
  return (

    <div className="ABMC">
        <div>
            <h2>
                Education: University of Florida
            </h2>

        </div>

    </div>
  );
}

export default AboutMe2;
